import Vue from 'vue'
import Router from 'vue-router'
import Home from './views/Home.vue'
import Dashboard from './views/Dashboard.vue'
import ProductsAdmin from './views/ProductsAdmin.vue'
import Checkout from './views/Checkout.vue'
import CheckoutInfo from './views/CheckoutInfo.vue'
import Courses from './views/Courses.vue'
import CourseDetails from './views/CourseDetails.vue'
import Orders from './views/Orders.vue'
import Overview from './views/Overview.vue'
import Profile from './views/Profile.vue'
import Cart from './views/Cart.vue'

Vue.use(Router);

export default new Router({

  routes: [{
      path: '*',
      redirect: '/'
    },
    {
      path: '/',
      name: 'home',
      component: Home,
    },
    {
      path: '/admin',
      name: 'dashboard',
      component: Dashboard,
      meta: {
        requiresAuth: true
      },
      children: [{
          path: 'products',
          name: 'productsAdmin',
          component: ProductsAdmin,
          meta: {
            requiresAuth: true
          }
        },
        {
          path: 'orders',
          name: 'Orders',
          component: Orders,
          meta: {
            requiresAuth: true
          }
        },
        {
          path: 'profile',
          name: 'Profile',
          component: Profile,
          meta: {
            requiresAuth: true
          }
        }
      ]
    },
    {
      path: '/courses',
      name: 'courses-index',
      component: Courses,
    },

    {
      path: '/courses/:course_name',
      name: 'CourseDetails',
      component: CourseDetails
    },
    {
      path: '/cart',
      name: 'Cart',
      component: Cart,
    },

    {
      path: '/checkout',
      name: 'Checkout',
      component: Checkout,
      meta: {
        requiresAuth: true
      }
    },

    {
      path: '/checkout/:paymentId',
      name: 'CheckoutInfo',
      component: CheckoutInfo,
      meta: {
        requiresAuth: true
      }
    },

  ]
})
